import React from 'react';

import necklesImage from './image/neckles.JPEG'; // Adjusted import path

function Home() {
  return (
    <div>
      
      <section className="section bg-c-light border-top">
        <div className="container">
          <div className="row">
            <div className="col-md-12 nb-4 text-center">
              
            </div>
            <div className="col-md-4">
              <div className="card shadow">
                
                <div className="card-body">
                
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
}

export default Home;
